import "./about.css";
import axios from 'axios';
import Navbar from "./Navbar";
import AboutmeList from "./AboutmeList";
<meta name="viewport" content="width = device-width, initial-scale=1.0" />;
export default function about() {
  const[aboutme, setabout] = useState();
    
    useEffect(()=>{
        // axios.get('https://jsonplaceholder.typicode.com/users')
        // .then(response =>{
        // {/*'https://jsonplaceholder.typicode.com/users'*/}
        //     setUsers(response.data);
        // });
        axios.get('http://api.1971artist.com:3000/admins/1',
        {
          headers:
          { 
            "x-access-token" : 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJhZG1pbklkIjoxLCJpYXQiOjE2NDA1OTk4MDcsImV4cCI6MTY3MjEzNTgwNywic3ViIjoidXNlckluZm8ifQ.FFgxskXgUuT2ARN0wKMF2K_YhxyhrLJ_8jfz7YE207Q'
            
          }
        })
        .then(response =>{
            
            setabout(response.data);
        });
    },[]);
  return (
    <div className="navbar">
      <Navbar></Navbar>
      <div>
        <section id="about">
          <div className="useraboutall">
            <div className="useraboutpic">
              <img
                src="https://images.unsplash.com/photo-1637541615205-8654ee01a032?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTYzODE5NDYyNA&ixlib=rb-1.2.1&q=80&w=1080"
                width="500"
                height="500"
              />
            </div>
            <div className="userim">
              <h2>name</h2>
              <h2>title</h2>

              <p>
                (history)Do not spoil what you have by desiring what you have
                not; but remember that what you now have was once among the
                things you only hoped for.
              </p>

              <p>
                (comment)Do not spoil what you have by desiring what you have
                not; but remember that what you now have was once among the
                things you only hoped for.
              </p>

              <div className="row">
                <div className="columns contact-details">
                  <p className="address">
                    <br />
                    <span>
                      address
                      <br />
                      <br />
                    </span>

                    <span>phone-num</span>
                    <br />
                    <br />
                    <span>email</span>
                    <br />
                    <br />
                    <span>sns</span>
                    <br />
                    <span>sns</span>
                    <br />
                    <span>sns</span>
                  </p>
                </div>
              </div>
            </div>
          </div>
          <AboutmeList aboutme = {aboutme}/>
        </section>
      </div>
    </div>
  );
}
